// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract CozyHomeNFT is ERC721 {
    using Strings for uint256;

    string private baseURI;
    uint256 private _tokenIds;
    uint256 public preSaleSupply = 1000;
    uint256 public totalSupply = 7999;
    uint256 public floorPrice = 0.05 ether;
    uint256 public preSaleFloor = 0.03 ether;
    uint256 public whiteListFloor = 0.025 ether;

    uint256 private whiteListCode = 4114;
    bool public preSale = true;
    address payable public owner;

    event CozyMinted(uint256 tokenId, address owner);
    event ReceivedEth(address, uint256);

    constructor() payable ERC721("Cozy Home NFT", "NFT") {
        owner = payable(msg.sender);
    }

    modifier onlyOwner(address sender) {
        require(sender == owner, "Not a owner call!");
        _;
    }

    // State Changes
    function changeFloorPrice(uint256 _new_price, uint256 _type)
        external
        onlyOwner(msg.sender)
    {
        if (_type == 0) {
            floorPrice = _new_price;
        } else if (_type == 1) {
            whiteListFloor = _new_price;
        } else if (_type == 2) {
            preSaleFloor = _new_price;
        }
    }

    // Get Information
    function getWalletBalance()
        public
        view
        onlyOwner(msg.sender)
        returns (uint256)
    {
        return address(this).balance;
    }

    // Contract ETH Relationship
    fallback() external payable {}

    receive() external payable {
        emit ReceivedEth(msg.sender, msg.value);
    }

    function transferContractBalance(
        address payable _recipient,
        uint256 _amount
    ) external onlyOwner(msg.sender) returns (bool) {
        require(_amount <= getWalletBalance(), "Not Enough Balance!");
        _recipient.transfer(_amount);
        return true;
    }

    // NFT Minting Related
    function setBaseURI(string memory _baseURILink)
        external
        onlyOwner(msg.sender)
    {
        baseURI = _baseURILink;
    }

    function getBaseURI()
        external
        view
        onlyOwner(msg.sender)
        returns (string memory)
    {
        return baseURI;
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    function tokenURI(uint256 tokenId)
        public
        view
        virtual
        override
        returns (string memory)
    {
        require(_exists(tokenId), "Nonexistent token!");

        return
            bytes(baseURI).length > 0
                ? string(abi.encodePacked(baseURI, tokenId.toString(), ".json"))
                : "";
    }

    function mintableLeft() external view returns (uint256) {
        return totalSupply - _tokenIds;
    }

    function changeSupply(uint256 _quantity) external onlyOwner(msg.sender) {
        totalSupply = _quantity;
    }

    function changeSaleState(bool _state) external onlyOwner(msg.sender) {
        preSale = _state;
    }

    function mintSale(
        address _recipient,
        uint256 _quantity,
        uint256 _whiteListCode
    ) public payable {
        require(
            _quantity > 0 && _quantity <= (totalSupply - _tokenIds),
            "Not Enough Reserve!"
        );

        uint256 _floorPrice;
        if (preSale && (_tokenIds < preSaleSupply)) {
            if (_whiteListCode == whiteListCode) {
                _floorPrice = whiteListFloor;
            } else {
                _floorPrice = preSaleFloor;
            }
        } else {
            _floorPrice = floorPrice;
        }

        if (msg.sender != owner) {
            require(
                msg.value == _floorPrice * _quantity,
                "Not Enough Balance!"
            );
        }
        uint256 j = _tokenIds;
        for (uint256 i = 0; i < _quantity; i++) {
            j++;
            _mint(_recipient, j);
            emit CozyMinted(j, _recipient);
        }
        _tokenIds = j;
    }
}
